document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".dropdown-trigger");M.Dropdown.init(e,{coverTrigger:!1,constrainWidth:!1,hover:!0})}),document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".sidenav");M.Sidenav.init(e)}),document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".collapsible");M.Collapsible.init(e,{onOpenStart:function(e,n){null!=e.firstElementChild.firstElementChild&&(e.firstElementChild.firstElementChild.innerHTML="arrow_drop_up")},onCloseStart:function(e,n){null!=e.firstElementChild.firstElementChild&&(e.firstElementChild.firstElementChild.innerHTML="arrow_drop_down")}})}),document.addEventListener("DOMContentLoaded",function(){var e=document.querySelectorAll(".slider");M.Slider.init(e,{height:350})});